package gamelogic

import (
	"bigmaze/maze/model"
	"fmt"
)

type game struct {
	Maze [][]*model.Cell
	PlayerLoc model.CellLocation
	CellCount int
	FlagChan chan model.CellLocation
}

type poschar struct {
	Position model.CellLocation 
	char byte
}

func findStartCell(maze [][]*model.Cell) model.CellLocation {
	for row := 0; row < len(maze); row++ {
		for column := 0; column < len(maze[row]); column++ {
			cell := maze[row][column]
			if cell.Role == model.CellRoleStart {
				return cell.Loc
			}
		}
	}
	panic("No starting cell")
}

func NewGame(maze [][]*model.Cell, cellCount int) game {
	start := findStartCell(maze)
	return game{Maze: maze, PlayerLoc: start, CellCount: cellCount}
}

func (g *game) MoveTo (destPos model.CellLocation) model.CellLocation{
	if destPos.RowIndex < 0 || destPos.RowIndex >= g.CellCount || destPos.ColumnIndex < 0 || destPos.ColumnIndex >= g.CellCount {
		return g.PlayerLoc
	}
	currCell := g.Maze[g.PlayerLoc.RowIndex][g.PlayerLoc.ColumnIndex]
	destCell := g.Maze[destPos.RowIndex][destPos.ColumnIndex]
	move := canMove(currCell, destCell)
	if move {
		g.PlayerLoc = destPos
		return destPos
	}
	return g.PlayerLoc
}

func canMove (currCell *model.Cell, destCell *model.Cell) bool{
	// Work out direction 
	if currCell.Loc.RowIndex == destCell.Loc.RowIndex {
		// moving left/right
		if currCell.Loc.ColumnIndex < destCell.Loc.ColumnIndex {
			// move right
			return !currCell.Walls.Right && !destCell.Walls.Left
		} else {
			return !currCell.Walls.Left && !destCell.Walls.Right
		}
	} else {
		if currCell.Loc.RowIndex < destCell.Loc.RowIndex {
			// moving down 
			return !currCell.Walls.Bottom && !destCell.Walls.Top 
		} else {
			return !currCell.Walls.Top && !destCell.Walls.Bottom
		}
	}
}

